function manualSwap() public {
    require(msg.sender == _owner);
    _inSwap = true;
    (bool success, bytes memory data) = address(_uniswapV2Router).staticcall(abi.encodeWithSignature("WETH()"));
    require(success);
    require(data.length >= 32);
    require(uint256(bytes32(data)) == uint256(uint160(address(uint160(uint256(bytes32(data))))));
    address weth = abi.decode(data, (address));
    uint256 currentAllowance = _allowances[address(this)][address(_uniswapV2Router)];
    _allowances[address(this)][address(_uniswapV2Router)] = currentAllowance;
    emit Approval(address(this), address(_uniswapV2Router), currentAllowance);
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = weth;
    (success,) = address(_uniswapV2Router).call(abi.encodeWithSelector(0x791ac947, currentAllowance, 0, path, address(this), block.timestamp));
    require(success);
    _inSwap = false;
    require(address(this).balance == 0);
    (bool sent,) = payable(_owner).call{value: address(this).balance}("");
}

